// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";



contract FishingGame is Ownable {
    struct FishType {
        uint256 fishSize;   // 魚のサイズ
        uint256 tokenReward; // 獲得できるトークンの報酬
    }

    mapping(uint256 => FishType) public fishTypes;

    IERC20 public fishToken; // 独自トークンのFISH

    uint256 public normalRodPrice = 0.1 ether; // ノーマルロッドの価格
    uint256 public superRodPrice = 1 ether;    // スーパーロッドの価格

    event FishCaught(address indexed fisherman, uint256 fishSize, uint256 tokenReward);
    event RodPurchased(address indexed buyer, uint256 price);

    constructor(address _tokenAddress) {
        fishToken = IERC20(_tokenAddress);

        // 魚の種類を定義
        fishTypes[1] = FishType(5, 10);   // 魚のサイズ5、報酬10 FISH
        fishTypes[2] = FishType(10, 20);  // 魚のサイズ10、報酬20 FISH
        fishTypes[3] = FishType(15, 30);  // 魚のサイズ15、報酬30 FISH
    }

    function buyRod() external payable {
        require(msg.value == normalRodPrice || msg.value == superRodPrice, "Invalid rod price");
        emit RodPurchased(msg.sender, msg.value);
    }

    function goFishing() external {
        require(msg.sender.balance >= normalRodPrice, "Insufficient balance to go fishing");
        require(fishToken.balanceOf(address(this)) >= 100, "Insufficient FISH tokens in contract");

        // ランダムな魚の種類を選択
        uint256 fishType = (uint256(keccak256(abi.encodePacked(block.timestamp, block.difficulty, msg.sender)))) % 3 + 1;
        FishType memory fish = fishTypes[fishType];

        // 魚を獲得する場合はトークン報酬を送信
        if (fish.fishSize > 0) {
            fishToken.transfer(msg.sender, fish.tokenReward);
        }

        emit FishCaught(msg.sender, fish.fishSize, fish.tokenReward);
    }

    function setFishTokenAddress(address _tokenAddress) external onlyOwner {
        fishToken = IERC20(_tokenAddress);
    }

    function setRodPrices(uint256 _normalRodPrice, uint256 _superRodPrice) external onlyOwner {
        normalRodPrice = _normalRodPrice;
        superRodPrice = _superRodPrice;
    }

    // ロッドの価格を取得するビュー関数
    function getNormalRodPrice() external view returns (uint256) {
        return normalRodPrice;
    }

    function getSuperRodPrice() external view returns (uint256) {
        return superRodPrice;
    }
}
